/** 
 * @file saf_utility_latticeCoeffs.c
 * @ingroup Utilities
 * @brief Lattice allpass coefficients which are useful for decorrelation
 *
 * The lattice allpass coefficients for the first 10 channels, for orders 20, 15
 * 6 and 3, were taken from the MPEG-Surround standard (ISO/IEC 23003-1) p133.
 * The remaining 246 sets of coefficients, and other orders, were then derived
 * via a brute-force optimisation routine, which asserted the following:
 * \code{.m}
 *     flag1 = isallpass(b,a);
 *     flag2 = isstable(b,a);
 *     [k,v] = tf2latc(b,a);
 *     flag3 = all(abs(k)< 1);
 *     assert(flag1*flag2*flag3)
 * \endcode
 * (asserting that the coefficients are indeed allpass, meet basic stability
 * requirements, and also meet the lattice allpass structure stability
 * requirements)
 *
 * The sets of coefficients were then selected based on decorrelating a mono
 * whitenoise signal, and picking the sets which met the near 0 interchannel
 * cross correlation coefficient per band and channel, when using: 20th order
 * filters up to 700Hz, 15th order up to 2.8kHz, 6th up to 4.5kHz, and 3rd
 * up to 12kHz. Along with fixed delays of [8, 7, 2, 1, 2], respectively.
 *
 * @author Leo McCormack
 * @date 07.07.2020
 */

